const Project = (props) => {
    const {
        id,
        owner,
        created_at,
        updated_at,
        project_name,
        is_owner,
    } = props;

    return (
        <Card className={styles.Project}>
            <Card.Body>
                {project_name && <Card.Title className="text-center">{project_name}</Card.Title>}

            </Card.Body>
        </Card>
    );
};

export default Project;
